import React from 'react'
import { Header } from './Header';
import './Login.css';

function UICONTROL() {
    const id_usuario = document.getElementsByClassName('id-usuario');
    id_usuario.innerText += "ALAM BRITO 20123";
    return (
        <div className='interfaz-login'><Header/>
            <div className='pantalla-login'>
                <a className='titulo-login'>INTERFAZ DE CONTROL</a>
                <a className='id-usuario'></a>
            </div>
        </div>

    )
}

export default UICONTROL;
